export class AppComponent {
  title = 'LVFX Production Management';
}
<app-navbar></app-navbar>
<div class="container-fluid">
  <div class="row">
    <main class="col-md-12 ms-sm-auto px-md-4">
      <router-outlet></router-outlet>
    </main>
  </div>
</div>
<app-footer></app-footer>
